import React from 'react';
import Banner from "./components.js";
import dancer_gif from './pics/dance_shark.gif';


class Fella extends React.Component {
  render() {
    const style = {
      position: "fixed",
      right: "-4em",
      bottom: "0",
      height: "20%"
    }
    return <img style={style} src={dancer_gif}/>;
  }
}

function App() {
  return (
    <>
      <Banner />
      <Fella />
    </>
  );
}

export default App;
